// import { Link } from 'react-router-dom';
import logo from './d1.jpg';
const Medical_center = ({ medical }) => {


    return (



        <div className="perintcared">
            {jacts.map((medical) => (
                <div class="card" key={medical.id}>
                    <img src={medical.imge} class="card-img-top" alt="" />

                    <div class="card-body">
                        <h5 class="card-title">{medical.title}</h5>
                        <h5 class="card-title">{medical.Location}</h5>
                        <h5 class="card-title">{medical.Workinghours}</h5>

                        <Link to={`/Details/${jack.id}`} className="btn btn-primary">Details</Link>
                    </div>
                </div>
            ))}
        </div>

    );

}
export default Medical_center;
